import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import Nav from 'react-bootstrap/Nav';
import { Component } from "react";

class LpNav extends Component{
    constructor() {
        super();
        this.state = {
          name: "React",
          showHideLog: true,
          
          showHideSign: false
        };
        this.hideComponent = this.hideComponent.bind(this);
      }
      hideComponent(name) {
        console.log(name);
        switch (name) {
          case "showHideLog":
            this.setState({ showHideLog: !this.state.showHideLog });
            break;
          case "showHideSign":
            this.setState({ showHideSign: !this.state.showHideSign });
            break;
            default:
              this.setState({ showHideLog: !this.state.showHideLog });
        }
      }
    render(){
        return(
           <Nav variant="tabs" defaultActiveKey="">
      <Nav.Item>
        <Nav.Link onClick={() => this.hideComponent("showHideLog")}>Log In</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link onClick={() => this.hideComponent("showHideSign")}>Sign Up</Nav.Link>
      </Nav.Item>
    </Nav>
        );
    }
}
export default LpNav;
